                               data = df1.head(50), palette ='copper');
        elif palette == 'summer':
            plot = sns.barplot(x = name, y ='Satellite',
                               data = df1.head(50), palette ='summer');
        elif palette == 'winter':
            plot = sns.barplot(x = name, y ='Satellite',
                               data = df1.head(50), palette ='winter');
        elif palette == 'spring':
            plot = sns.barplot(x = name, y ='Satellite',
                               data = df1.head(50), palette ='spring');
