            plot = sns.barplot(x = name, y ='Satellite',
                               data = df1.head(50));
        plt.xlabel(xlabel);
        plt.ylabel(ylabel);
        plt.title(title);
    elif state == 'h' : #different orientation
        if palette == 'BuGn':
            plot = sns.barplot(y = name, x ='Satellite',
                               data = df1.head(50), orient = 'h', palette ='BuGn');
        elif palette == 'summer':
            plot = sns.barplot(y = name, x ='Satellite',
                               data = df1.head(50), orient = 'h', palette ='summer');
        elif palette == 'winter':
